CREATE DEFINER=`root`@`localhost` EVENT `clientSaldo` ON SCHEDULE EVERY 1 DAY STARTS '2011-07-20 02:00:00' ON COMPLETION NOT PRESERVE DISABLE DO BEGIN
	DECLARE done INT DEFAULT 0;
	DECLARE gid INT;
	
	DECLARE curl CURSOR FOR
		SELECT
			id
		FROM summary_report_header
		WHERE report_date = DATE(NOW() - INTERVAL 1 DAY)
        	AND client_id NOT IN (0);

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	OPEN curl;
	REPEAT
		FETCH curl INTO gid;
		IF NOT done THEN
			SELECT
				client_id, total_saldo
			INTO @vClientID, @vTotalSaldo
			FROM summary_report_header
			WHERE id = gid
				AND report_date = DATE(NOW() - INTERVAL 1 DAY);

			SELECT
				remain_saldo
			INTO @vRemainSaldo
			FROM client_saldo
			WHERE client_id = @vClientID;

			UPDATE client_saldo SET
				remain_saldo = @vRemainSaldo-@vTotalSaldo
			WHERE client_id = @vClientID;
		END IF;

	UNTIL done END REPEAT;
	CLOSE curl;
END$$

CREATE DEFINER=`root`@`localhost` EVENT `summaryReportHeader` ON SCHEDULE EVERY 1 DAY STARTS '2011-07-22 01:00:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
		set time_zone = '+07:00';
    
		SELECT
			client_id,
			SUM(total_km) AS km,
			SUM(total_saldo) AS saldo,
			SUM(total_viewer) AS viewer,
			report_date
		FROM summary_report_detail_tes
		WHERE report_date = DATE(NOW() - INTERVAL 1 DAY)
		GROUP BY client_id;
END$$

CREATE DEFINER=`root`@`localhost` EVENT `summarySaldoDriver` ON SCHEDULE EVERY 1 DAY STARTS '2011-09-26 01:30:00' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
	DECLARE done INT DEFAULT 0;
	DECLARE gid INT;
	DECLARE tSaldo DECIMAL(10.5);
	DECLARE tDanaDriver DECIMAL(10.5);
	DECLARE tDanaTempelAD DECIMAL(10.5);
	
	DECLARE curl CURSOR FOR
		SELECT
			DISTINCT(driver_id)
		FROM summary_report_detail_tes
		WHERE report_date = DATE(NOW() - INTERVAL 1 DAY);

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
    
	set time_zone = '+07:00';

	OPEN curl;
	REPEAT
		FETCH curl INTO gid;
		IF NOT done THEN
			SELECT
				phone, SUM(total_saldo) AS saldo, report_date, SUM(dana_driver) AS dana_driver, SUM(dana_tempelad) AS dana_tempelad, total_km
			INTO @vPhone, @vSaldo, @vReportDate, @vDanaDriver, @vDanaTempelAD, @vTotalKM
			FROM summary_report_detail_tes
			WHERE driver_id = gid AND report_date = DATE(NOW() - INTERVAL 1 DAY);

			IF CAST(@vTotalKM AS UNSIGNED) < 100 THEN
					driver_id, driver_phone, saldo, dana_driver, dana_tempelad, balance_date
				) VALUES (
					gid, @vPhone, @vSaldo, @vDanaDriver, @vDanaTempelAD, @vReportDate
				);
			ELSE
				SET tSaldo = (100*@vSaldo)/@vTotalKM;
				SET tDanaDriver = (100*@vDanaDriver)/@vTotalKM;
				SET tDanaTempelAD = (100*@vDanaTempelAD)/@vTotalKM;
				
				
					driver_id, driver_phone, saldo, dana_driver, dana_tempelad, balance_date
				) VALUES (
					gid, @vPhone, tSaldo, tDanaDriver, tDanaTempelAD, @vReportDate
				);
			END IF;
		END IF;

	UNTIL done END REPEAT;
	CLOSE curl;
END$$

