CREATE DEFINER=`root`@`localhost` EVENT `updIdStart` ON SCHEDULE EVERY 1 DAY STARTS '2011-07-22 12:45:00' ON COMPLETION NOT PRESERVE DISABLE DO BEGIN
	DECLARE done INT DEFAULT 0;
	DECLARE gid INT;
	
	DECLARE curl CURSOR FOR
		SELECT
			id
		FROM summary_report_detail
		WHERE report_date < DATE(NOW())
			AND id_end = 1
		GROUP BY driver_id, trip_to, report_date;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	OPEN curl;
	REPEAT
		FETCH curl INTO gid;
		IF NOT done THEN
			SELECT
				phone, report_date
			INTO @vPhone, @vReportDate
			FROM summary_report_detail
			WHERE id = gid;

			SELECT
				id, pinOnTime
			INTO @vIdStart, @vDateStart
			FROM tracking_detail
			WHERE hpnumber = @vPhone
				AND DATE_FORMAT(pinOnTime, '%Y-%m-%d') = @vReportDate
			ORDER BY id ASC LIMIT 1;

			SELECT
				id, pinOnTime
			INTO @vIdEnd, @vDateEnd
			FROM tracking_detail
			WHERE hpnumber = @vPhone
				AND DATE_FORMAT(pinOnTime, '%Y-%m-%d') = @vReportDate
			ORDER BY id DESC LIMIT 1;

			SELECT timediff(@vDateEnd, @vDateStart) INTO @vDuration;

			UPDATE summary_report_detail SET
				id_start = @vIdStart,
				id_end = @vIdEnd,
				duration = @vDuration
			WHERE phone = @vPhone
				AND report_date = @vReportDate;
		END IF;

	UNTIL done END REPEAT;
	CLOSE curl;
END$$

